package com.ufgov.zc.client.component.table.codecelleditor;import java.awt.Component;import javax.swing.AbstractCellEditor;import javax.swing.JTable;import javax.swing.table.TableCellEditor;import com.ufgov.zc.client.component.element.ManageForBiXJTableSelectField;import com.ufgov.zc.common.commonbiz.model.Manage;public class ManageForBiXJSelectFieldCellEditor extends AbstractCellEditor implements TableCellEditor {  private static final long serialVersionUID = -1195669763042974933L;  private ManageForBiXJTableSelectField editorComponent = new ManageForBiXJTableSelectField(20);  public ManageForBiXJSelectFieldCellEditor() {  }  public Component getTableCellEditorComponent(JTable table, Object value, boolean isSelected, int row,  int column) {    editorComponent.setValueByCode((String) value);    return editorComponent;  }  public Object getCellEditorValue() {    String code = null;    Manage value = editorComponent.getManage();    if (value != null) {      code = value.getCode();    }    return code;  }}